var accepted_lines = 0;
var live_lines = 0;
var cur = null;
var curLive = null;
var next = null;
var nextLive = null;

for (var i = 0; i < betslip.length; i++) {
    if (betslip[i].outcome.odd >= 1.1) {
        accepted_lines++;
        if (betslip[i].bet.betTypeIsLive) {
            live_lines++;
        }
    }
}
