        break;
    case 10:
        curLive = 1.6;
        nextLive = 1.8;
        break;
    case 11:
        curLive = 1.8;
        nextLive = 2;
        break;
    case 12:
        curLive = 2;
        nextLive = 2;
        break;
    default:
        curLive = 2;
        nextLive = 2;
}


var result = {
    current: ( curLive >= cur ? curLive : cur),
    next: (nextLive >= next ? nextLive : next),
    live: (nextLive >= next ? true : false),
};
return result;
